import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
 // Assuming you will create a separate CSS file for styling

function ProductList() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    // Dummy Product Data
    const dummyProducts = [
      {
        id: 1,
        name: "Wireless Headphones",
        description: "High-quality wireless headphones with noise cancellation.",
        rating: 4,
        imageUrl: "https://encrypted-tbn0.gstatic.com/shopping?q=tbn:ANd9GcSCi8sDYK8082GpTkWjB4a2FYP3P-t3WL3lPcPGRykZZZd4xXr6DUDf-zlCGPIbXVxiFRX8_nuZRlWchz13rfit8GO8yQQnvW3gQ9Hh4mPiTjAuYhGogZE-",
      },
      {
        id: 2,
        name: "Smart Watch",
        description: "Track your health, notifications, and more with this stylish smart watch.",
        rating: 5,
        imageUrl: "https://www.gonoise.com/cdn/shop/files/1_ca923369-0c7a-45d7-8edc-7a487a3b5fc6.png?v=1711280604",
      },
      {
        id: 3,
        name: "Gaming Laptop",
        description: "A powerful gaming laptop with a fast processor and high-end GPU.",
        rating: 3,
        imageUrl: "https://via.placeholder.com/200x200?text=Gaming+Laptop",
      },
      {
        id: 4,
        name: "Bluetooth Speaker",
        description: "Portable Bluetooth speaker with great sound quality and long battery life.",
        rating: 4,
        imageUrl: "https://via.placeholder.com/200x200?text=Bluetooth+Speaker",
      },
      {
        id: 5,
        name: "Smartphone",
        description: "Latest model smartphone with a stunning camera and long-lasting battery.",
        rating: 5,
        imageUrl: "https://via.placeholder.com/200x200?text=Smartphone",
      },
    ];

    // Set the dummy products as the initial data
    setProducts(dummyProducts);
  }, []);

  return (
    <div className="product-list-container">
      <h2 className="heading">Product List</h2>
      <div className="product-container">
        {products.map((product) => (
          <div className="product-card" key={product.id}>
            <img src={product.imageUrl} alt={product.name} className="product-image" />
            <h3 className="product-name">{product.name}</h3>
            <p className="product-description">{product.description}</p>
            <div className="product-rating">
              {[...Array(5)].map((_, index) => (
                <span key={index} className={index < product.rating ? 'filled' : 'empty'}>
                  â˜…
                </span>
              ))}
            </div>
            <Link to={`/product/${product.id}`} className="view-button">View</Link>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ProductList;
